import React from 'react';

const TitleBox = () => (
    <image></image>
)

const HeaderMenu = () => (
    <div className='HeaderBar'>
        <nav>
            <h1 className='HeaderTitle'>
                <img src='./../Logo1.jpg'></img>
            </h1>
            <span>성신여대입구</span>
            <span>한성대입구</span>
            <span>혜화</span>
        </nav>
    </div>
)

export default HeaderMenu;
